import { GET_PORJECTS } from '../actions/types';
const inistalState = {
  projects: [],
  project: {}
};

export default function(state = inistalState, action) {
  switch (action.type) {
    case GET_PORJECTS:
      return {
        ...state,
        projects: action.payload
      };
    default:
      return state;
  }
}
